function findPeaks(chart, start, end, d) {
    return chart.reduce(function (agg, current, i) {

        if (i >= start && i <= end) {
            if (current === math.max([...chart.slice(i - d, i + d + 1), -Infinity]) && current !== chart[i - 1]) {
                agg.push(current - (findValleys(chart.slice(i - (4 * d), i), d).at(-1)) ?? 0);
            }
        }
        //return current === math.max([...chart.slice(i - d, i + d + 1), -Infinity]) && current !== chart[i - 1] && i >= d && i <= end ? [...agg, (current - findValleys(chart.slice(i - 4 * d, i),d).at(-1))] : agg;
        return agg;
    }, []);
}

function findValleys(chart, d) {
    const end = chart.length - d;
    return chart.reduce((/** @type {array} */ agg, /** @type {number} */ current, /** @type {number} */ i) => {
        return current === math.min([...chart.slice(i - d, i + d + 1), Infinity]) && i >= d && i <= end ? [...agg, current] : agg;
    }, []);
}


function hpf(x, cut, dt){
    const rc = 1 / (cut*2*math.pi);
    const a = rc / (rc + dt);
    return x.reduce(function(y, xi, i) {
        if (i > 0){
            y.push(a*(y[i-1] + x[i] - x[i-1]));
        }
        return y;        
    }, [x[0]]);
}

