// thresholds
const FAIL_OPEN_OHM = 10.0;
const CLOSED_THRESH_OHM = 1.0;
const BOUNCE_LIMIT_MS = 2.0;
const stableN = Math.max(1, Math.ceil((BOUNCE_LIMIT_MS / 1000) / DT));

// Parse CSV
let s = (msg.payload || '').toString().trim();
let parts = s.split(',');
let arr = [];
for (let i = 0; i < parts.length; i++) {
  let v = Number(parts[i]);
  if (Number.isFinite(v)) arr.push(v);
}
if (arr.length < 50) {
  return [null, { payload: { data: [] } }, { payload: `Prea puine samples: ${arr.length}` }];
}

// Build chart messages (one point per msg) for Dashboard 2 ui-chart
