  topic: 'R_mOhm',
  payload: v * 1000,
  timestamp: t0 + i * DT * 1000
}));

// Per-contact windows
let winLen = Math.floor(arr.length / PULSES);
if (winLen < 2) winLen = 2;

function median(xs) {
  if (xs.length === 0) return NaN;
  let a = xs.slice().sort((a, b) => a - b);
  let m = Math.floor(a.length / 2);
  return (a.length % 2) ? a[m] : 0.5 * (a[m - 1] + a[m]);
}

