let worstBounce = 0;

for (let c = 0; c < PULSES; c++) {
  let start = c * winLen;
  let end = (c === PULSES - 1) ? arr.length : (c + 1) * winLen;
  let w = arr.slice(start, end);

  let maxOhm = -Infinity;
  for (let v of w) if (v > maxOhm) maxOhm = v;
  let hasOpen = (maxOhm > FAIL_OPEN_OHM);

  let firstClosed = -1;
  for (let i = 0; i < w.length; i++) {
    if (w[i] < CLOSED_THRESH_OHM) { firstClosed = i; break; }
  }

  let bounceMs = NaN;
  let stableIdx = -1;
  if (firstClosed >= 0) {
    for (let i = firstClosed; i <= w.length - stableN; i++) {
      let ok = true;
      for (let k = 0; k < stableN; k++) {
        if (!(w[i + k] < CLOSED_THRESH_OHM)) { ok = false; break; }
      }
      if (ok) { stableIdx = i; break; }
    }
    bounceMs = (stableIdx >= 0)
      ? (stableIdx - firstClosed) * DT * 1000
      : (w.length - firstClosed) * DT * 1000;
  }

  if (Number.isFinite(bounceMs) && bounceMs > worstBounce) worstBounce = bounceMs;

  // contact resistance from stable region
  let rOhm = NaN;
  if (stableIdx >= 0) {
    let stable = w.slice(stableIdx + stableN).filter(v => v < CLOSED_THRESH_OHM);
    rOhm = median(stable);
  }

  let failBounce = Number.isFinite(bounceMs) ? (bounceMs > BOUNCE_LIMIT_MS) : true;
  let failNoClose = (firstClosed < 0);
  let status = (hasOpen || failBounce || failNoClose) ? 'FAIL' : 'PASS';
  if (status === 'FAIL') failCount++;

  rows.push({
    contact: c + 1,
    r_mOhm: Number.isFinite(rOhm) ? rOhm * 1000 : null,
    bounce_ms: Number.isFinite(bounceMs) ? bounceMs : null,
    max_ohm: Number.isFinite(maxOhm) ? maxOhm : null,
    status
  });
}

let summary = `pulses=${PULSES} samples=${arr.length} dt=${(DT * 1000).toFixed(3)}ms failCount=${failCount} worstBounce=${worstBounce.toFixed(2)}ms`;

// out1: array of chart points -> split -> ui-chart
// out2: ui-table expects payload.data
// out3: summary text
return [
  { payload: chartMsgs },
  { payload: { data: rows } },
  { payload: summary }
];

let data = flow.get("data") ?? [];

if (msg.topic === "update") {
    if (data.length>0) {
        for (let i=0; i<data.length; i++) {
            data[i].current += Math.floor(Math.random()*5-2);
        }
        context.set("data", data);
        msg.payload = data;
        return msg;
    }
} else {
    flow.set("data", msg.payload);
    return msg;
}

let data = flow.get("data") ?? [];

if ((msg.topic === "plus") || (msg.topic === "minus")) {
    for (let i=0; i<data.length; i++) {
        if (data[i].id === msg.payload.id) {
            if (msg.topic === "plus") {
                data[i].target += 0.5;
            } else {
                data[i].target -= 0.5;
            }
        }
    }
    msg.payload = data;
    return msg;
}

