# Selection, Response and Headers

## Controlling Selection

The above example shows how to handle selection of records in the table. Some additional attribures are added to the `v-data-table`:
- `show-select` turns on the checkboxes at the beginning or each row
- `select-strategy="all"` specifies that multiple items are selectable. This could be `single` as well
- `item-selectable="selectable"` sets that items are selectable at all
- `return-object` controls that whenever the selection changes the selected item(s) are outputted on the output port of the template node
- `v-model="selected"` specify where to store the selected items.

Initialized the value or `selected`:
```
    data () {
      return {
        selected: [],
        search: ''
      }
    },
```
And also added a watch function to send the content out when the selection changes:
```
    watch: {
        selected: function () {
          this.send({topic:'selected', payload: this.selected});
        }
    },
```

## Headers

In this example the input data has a lot of fields that are not to be displayed on in the table. Therefore in `v-data-table` and additional attribute is added: `:headers="msg.headers"`. This sets that the headers to be used are stored in `msg.headers` of the incoming message.
And that is set by the change node before this template node. It contains an array with items like this:
```
    {
        "title": "Name",
        "value": "fname",
        "sortable": true
    },
```
Where `title` is the column headers visible on the screen, `value` is the field name is the structure, and `sortable` controls if the column header can be clicked on for sorting. I turned off sorting by the icon.



<template>
    <!-- Provide an input text box to search the content -->
    <v-text-field v-model="search" label="Search" prepend-inner-icon="mdi-magnify" single-line variant="outlined"
        hide-details></v-text-field>
    <v-data-table 
      v-model:search="search" 
      :items="msg?.payload" 
      :headers="msg?.headers"
      v-model="selected"
      item-selectable="selectable"
      select-strategy="all"
      show-select    
      return-object
    >

      <template v-slot:item.icon="{ item }">
        <v-icon :icon="item.icon"></v-icon>
      </template>

    </v-data-table>
</template>

<script>
    export default {
    data () {
      return {
        selected: [],
        search: ''
      }
    },
    watch: {
        selected: function () {
          this.send({topic:'selected', payload: this.selected});
        }
    },
    methods: {
        // add a function to determine the color of the progress bar given the row's item

    }
  }
</script>
